 probe that is currently orbiting the planet Jupiter. It was built by Lockheed Martin and is operated by NASAs Jet Propulsion Laboratory.[The spacecraft was launched from Cape Canaveral Air Force Station on August 5, 2011, as part of the New Frontiers program](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29). Junos mission is to measure Jupiters composition, gravitational field, magnetic field, and polar magnetosphere.[It will also search for clues about how the planet formed, including whether it has a rocky core, the amount of water present within the deep atmosphere, mass distribution, and its deep winds](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29).[Juno is the second spacecraft to orbit Jupiter, after the Galileo orbiter, which orbited from 1995 to 2003](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29).[Unlike all earlier spacecraft sent to the outer planets, Juno is powered by solar panels](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29).logseq____&quot;,536870996]],[logseq____&quot;^15logseq____&quot;,[1815,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870996]],[logseq____&quot;^15logseq____&quot;,[1815,logseq____&quot;^Flogseq____&quot;,174,536870996]],[logseq____&quot;^15logseq____&quot;,[1815,logseq____&quot;^Xlogseq____&quot;,174,536870996]],[logseq____&quot;^15logseq____&quot;,[1815,logseq____&quot;^Vlogseq____&quot;,174,536870996]],[logseq____&quot;^15logseq____&quot;,[1815,logseq____&quot;^Ulogseq____&quot;,174,536870996]],[logseq____&quot;^15logseq____&quot;,[1815,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u65a41dcf-06f1-4dcb-bd43-d7c7897a7dcdlogseq____&quot;,536870996]],[logseq____&quot;^15logseq____&quot;,[1817,logseq____&quot;^Klogseq____&quot;,1705254351836,536870997]],[       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
